aggregateTestResults.map:
function (doc) {
  for (var index in doc.result) {
    for(var secondaryIndex in doc.result[index]) {
      emit([doc.date, doc.result[index][secondaryIndex].intent],[doc.result[index][secondaryIndex].confidence, doc.result[index][secondaryIndex].successRatio, doc.result[index][secondaryIndex].totalTestCases, 1]);
    }
  }
}
